import React from "react";
import leftdetails from "./event7detailleft";
import Event7left from "./event7left";
import "./staff.css";
import "./cauvong.css";

const Event7 = () => {
    return(
        <div className="row justify-content-center event7">
            {leftdetails.map((borderleft,index) =>(<Event7left key = {index} {...borderleft} />))}  
            <div className="row justify-content-center event7">
                <div className="text-center col-10">
                  <h1 className="text-center h1text text-2">
                    Now you don't have to
                    <strong> hire, train and manage </strong>
                    an entire in-house development team
                  </h1>
                  <p className="text-center event7p">
                    Specialists for hard-to-fit positions. Based in US time zones.
                  </p>
            </div>

            </div>
        </div>
    );
};

export default Event7;
